import React from 'react';
 import './Section.css';




 const Section = () => {
   return (
     <>
       <div className="fotorama" data-autoplay="true" data-fit="cover" data-width="100%" data-height="600">
         <img src="https://farm9.staticflickr.com/8053/8087247038_6138284941_b.jpg" alt="" data-caption="<b>amira_a</b> eyes to the past" />
         <img src="https://farm8.staticflickr.com/7356/9569443245_cd4ce1b05e_b.jpg" alt="" />
         <img src="https://farm9.staticflickr.com/8455/8008893480_9f27f5166b_b.jpg" alt="" />
         <img src="https://farm9.staticflickr.com/8432/7757814304_602435db95_b.jpg" alt="" />
         <img src="https://farm8.staticflickr.com/7072/7369499166_4e68c0700d_b.jpg" alt="" />
         <img src="https://farm8.staticflickr.com/7166/6818537173_a20f1de728_b.jpg" alt="" />
         <img src="https://farm7.staticflickr.com/6162/6200933313_14185fee1f_b.jpg" alt="" />
         <img src="https://farm5.staticflickr.com/4033/4335430788_60a6572149_b.jpg" alt="" />
       </div>
       <section className="home-section seperator">
         <div className="container">
           
         </div>
       </section>
       <section className="home-section full">
         <div className="container">
           {/* Your content here */}
         </div>
       </section>
     </>
   );
 };
 
 export default Section;
